 2018, by Ubisoft, with the first gameplay footage being premiered at the Electronic Entertainment Expo 2018 in June 2018, In the Expo, Ubisoft confirmed that the game will be released on 15 March 2019 for Microsoft Windows, PlayStation 4 and Xbox One. A private beta is set to launch prior to the game release. The beta started on February 7, 2019 and ended four days later on February. After the game's release, three episodes of downloadable content, which add new story content and gameplay modes, will be released for all players.\n\n\n"},{"text":"#thedivision2","navigationEndpoint":{"clickTrackingParams":"CM4BENzXBBgIIhMIvfrZ9OP_-gIVS4D0Bx3fkAse","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/thedivision2","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUOCgx0aGVkaXZpc2lvbjI%3D"}},"loggingDirectives":{"trackingParams":"CM4BENzXBBgIIhMIvfrZ9OP_-gIVS4D0Bx3fkAse","visibility":{"types":"12"},"enableDisplayloggerExperiment":true}},{"text":" "},{"text":"#division2xp","navigationEndpoint":{"clickTrackingParams":"CM0BENzXBBgKIhMIvfrZ9OP_-gIVS4D0Bx3fkAse","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/division2xp","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUNCgtkaXZpc2lvbjJ4cA%3D%3D"}},"loggingDirectives":{"trackingParams":"CM0BENzXBBgKIhMIvfrZ9OP_-gIVS4D0Bx3fkAse","visibility":{"types":"12"},"enableDisplayloggerExperiment":true}},{"text":" "},{"text":"#division2farm","navigationEndpoint":{"clickTrackingParams":"CMwBENzXBBgMIhMIvfrZ9OP_-gIVS4D0Bx3fkAse","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/division2farm","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUPCg1kaXZpc2lvbjJmYXJt"}},"loggingDirectives":{"trackingParams":"CMwBENzXBBgMIhMIvfrZ9OP_-gIVS4D0Bx3fkAse","visibility" ame, Massive Entertainment planned to include more game content at launch and improve the endgame.The game's endgame development was prioritized by Massive Entertainment after hearing players' complaints from the first game.\n\n\nThe game was announced on March 9, 2018, by Ubisoft, with the first gameplay footage being premiered at the Electronic Entertainment Expo 2018 in June 2018, In the Expo, Ubisoft confirmed that the game will be released on 15 March 2019 for Microsoft Windows, PlayStation 4 and Xbox One. A private beta is set to launch prior to the game release. The beta started on February 7, 2019 and ended four days later on February. After the game's release, three episodes of downloadable content, which add new story content and gameplay modes, will be released for all players.\n\n\n"},{"text":"#thedivision2","navigationEndpoint":{"clickTrackingParams":"CCoQ3NcEGAgiEwi9-tn04__6AhVLgPQHHd-QCx4=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/thedivision2","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUOCgx0aGVkaXZpc2lvbjI%3D"}},"loggingDirectives":{"trackingParams":"CCoQ3NcEGAgiEwi9-tn04__6AhVLgPQHHd-QCx4=","visibility":{"types":"12"},"enableDisplayloggerExperiment":true}},{"text":" "},{"text":"#division2xp","navigationEndpoint":{"clickTrackingParams":"CCkQ3NcEGAoiEwi9-tn04__6AhVLgPQHHd-QCx4=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/division2xp","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUNCgtkaXZpc2lvbjJ4cA%3D%3D"}},"loggingDirectives":{"trackingParams":"CCkQ3NcEGAoiEwi9-tn04__6AhVLgPQHHd-QCx4=","visibility":{"types":"12"},"enableDisplayloggerExperiment":true}},{"text":" "},{"text":"#division2farm","navigationEndpoint":{"clickTrackingParams":"CCgQ3NcEGAwiEwi9-tn04__6AhVLgPQHHd-QCx4=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/divisio
